text_show:
Nkwakọ ngwaahịa akpa-in-the-igbe, nke a na-akpọ nkwakọ ngwaahịa BIB, bụ ụdị nkwakọ ngwaahịa kacha aga nke ọma na nkwakọ ngwaahịa ọhụrụ zuru ụwa ọnụ n'afọ ndị na-adịbeghị anya. N'ihi njirimara ya nke nchekwa, ahụike, ịdị mma na nchebe gburugburu ebe obibi, ọ na-etolite ngwa ngwa n'ime nkwakọ ngwaahịa ihe ọṅụṅụ nke ndị na-azụ ahịa dị njikere ịhọrọ n'ahịa Europe na America.
Akpa n'ime nkwakọ ngwaahịa igbe
1. Akpa n'ime igbe na-eji obere ihe nkwakọba ihe karịa arịa siri ike naanị 1/5;
2, ngwugwu akp
... 
gbe eji eme ihe dị mfe ikewapụ na megharịa, megharịa kpamkpam;
3, akpa dị n'ime igbe ahụ nwere ike ịgbaji kpamkpam tupu na mgbe ejiri ya mee ihe, na-ebelata oke nchekwa nchekwa na ụgwọ njem, belata oriri ike;
4. Ọtụtụ n'ime akpa ndị dị na igbe ahụ bụ nke a na-ewepụ, na-ezere mmetụta na mmebi nke nsị kemịkal na nhicha na gburugburu ebe obibi;
5. Ngwunye kachasị elu nwere ike ruo 1400 lita, nke pụtara obere nkwakọ ngwaahịa kwa otu ikike;
6, ogologo ndụ nchekwa ngwaahịa na-ebelatakwa ihe mkpofu nke
...
bi ngwaahịa kpatara;
7, belata oriri ume na ihe eji eme ihe;
8, igbe nkwakọ ngwaahịa dị arọ dị mfe, chekwaa ohere, nwere ike melite arụmọrụ njem nke ihe karịrị 20%, belata mmanụ ọkụ na ike oriri;
9, otu njem (mgbe siri ike imegharị ihe adịghị mkpa iji megharịa) iji chekwaa ụgwọ njem;
10, ma e jiri ya tụnyere ụdị nkwakọ ngwaahịa ọdịnala nwere ike ịchekwa ihe ruru 80% nke oriri akụrụngwa;
Igwe ndochi na-agbanwe agbanwe na nke ọma iji belata ọnụ ahịa ume ma melite nrụpụta.
Oge nzipu: Ọktoba 28-2021

Nchịkọta ọgba tum tum GR1 Pro 250 CC
]Ihe nlereanya a sitere na ọgba tum tum Nicot, GR1 bụ otu n'ime usoro ha nyere anyị, etinyere ihe nlereanya a na injin ZS CB250D-G, ike Max 12KW, na-achọ igwe kwụ ọtọ unyi na wheelbase 1340mm, ntupu mgbe niile, nnyefe 2-ogbo. , 5 gia shift, niile na-enye anyị ike ike nakwa na elu ngagharị na ike ka anyị na-anụ ụtọ ịrị na ọduọ n'ime ọhịa na ọhịa.
Igwe moto Nicot bụ ọkachamara na-emepụta ọgba tum tum na China, ha na-enye anyị motocross dị elu na ọrụ a pụrụ ịdabere na ya, ha na-enyekwa anyị ọnụahịa dị mma na ọrụ OEM anyị chọrọ. anyị na-eju afọ nke ukwuu na ha yana motocross ha wetara anyị, anyị na-akwado gị na ndị na-ebubata ngwaahịa a dị mma.
